    #[test]
    fn test_block_header_stream() {
        let block_header = BlockHeader {
            version: 1,
            previous_header_hash: [2; 32].into(),
            merkle_root_hash: [3; 32].into(),
            hash_final_sapling_root: None,
            time: 4,
            bits: BlockHeaderBits::Compact(5.into()),
            nonce: BlockHeaderNonce::U32(6),
            solution: None,
            solution_size: None,
            aux_pow: None,
            mtp_pow: None,
            is_verus: false,
        };

        let mut stream = Stream::default();
        stream.append(&block_header);

        let expected = vec![
            1, 0, 0, 0, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2,
            3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 4, 0, 0, 0,
            5, 0, 0, 0, 6, 0, 0, 0,
        ]
        .into();

        assert_eq!(stream.out(), expected);
    }

    #[test]
    fn test_block_header_reader() {
        let buffer = vec![
            1, 0, 0, 0, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2,
            3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 4, 0, 0, 0,
            5, 0, 0, 0, 6, 0, 0, 0,
        ];

        let mut reader = Reader::new(&buffer);

        let expected = BlockHeader {
            version: 1,
            previous_header_hash: [2; 32].into(),
            merkle_root_hash: [3; 32].into(),
            hash_final_sapling_root: Default::default(),
            time: 4,
            bits: BlockHeaderBits::Compact(5.into()),
            nonce: BlockHeaderNonce::U32(6),
            solution_size: None,
            solution: None,
            aux_pow: None,
            mtp_pow: None,
            is_verus: false,
        };

        assert_eq!(expected, reader.read().unwrap());
        assert_eq!(ReaderError::UnexpectedEnd, reader.read::<BlockHeader>().unwrap_err());
    }

    #[test]
    fn test_sapling_block_header_serde() {
        // block header of https://kmdexplorer.io/block/01ad31e22fea912a974c3e1eea11dc26348676528a586f77199ac3cfe29e271f
        let header_hex = "";
        let header_bytes: Vec<u8> = header_hex.from_hex().unwrap();
        let header: BlockHeader = deserialize(header_bytes.as_slice()).unwrap();
        let expected_header = BlockHeader { version: 4, previous_header_hash: "8e4e7283b71dd1572d220935db0a1654d1042e92378579f8abab67b143f93a02".into(), merkle_root_hash: "fa026610d2634b72ff729b9ea7850c0d2c25eeaf7a82878ca42a8e9912028863".into(), hash_final_sapling_root: Some("a2d8a734eb73a4dc734072dbfd12406f1e7121bfe0e3d6c10922495c44e5cc1c".into()), time: 1583159441, bits: BlockHeaderBits::U32(486611429), nonce: BlockHeaderNonce::H256("0400b9caaf41d4b63a6ab55bb4e6925d46fc3adea7be37b713d3a615e7cf0000".into()), solution_size: Some(1344u32.into()), solution: Some("".into()), aux_pow: None, mtp_pow: None, is_verus: false };
        assert_eq!(expected_header, header);
        let serialized = serialize(&header);
        assert_eq!(serialized.take(), header_bytes);
    }

